import React from "react";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";

function Patientx() {
  return (
    <>
      <h1 style={{fontFamily:"sans-serif"}}>
        ------------------------Patient
        SignUp!!-------------------------
      </h1>

      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "80vh",
          width: "40vh 40vh",
          border: "2px solid gray", // Add a black border
          margin: "120px 540px 120px 540px", // Add margin around the component
        }}
      >
        <Form>
          <Form.Group className="mb-3" controlId="formBasicEmail">
            <Form.Label style={{fontFamily:"sans-serif"}}>Email</Form.Label>
            <Form.Control
              type="email"
              style={{
                height: "50px",
                borderRadius: "0",
                borderColor: "black",
                borderWidth: "2px",
              }}
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="formBasicPassword">
            <Form.Label style={{fontFamily:"sans-serif"}}>Password</Form.Label>
            <Form.Control
              type="password"
              style={{
                height: "50px",
                borderRadius: "0",
                borderColor: "black",
                borderWidth: "2px",
              }}
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="formBasicPassword">
            <Form.Label style={{fontFamily:"sans-serif"}}>patientId</Form.Label>
            <Form.Control
              type="text"
              style={{
                height: "50px",
                borderRadius: "0",
                borderColor: "black",
                borderWidth: "2px",
              }}
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="formBasicPassword">
            <Form.Label style={{fontFamily:"sans-serif"}}>Name</Form.Label>
            <Form.Control
              type="text"
              style={{
                height: "50px",
                borderRadius: "0",
                borderColor: "black",
                borderWidth: "2px",
              }}
            />
          </Form.Group>

          <div
            style={{
              display: "flex",
              justifyContent: "space-between",
              marginTop: "20px", // Adjust the margin as needed
            }}
          >
            <Button variant="dark" type="submit" size="lg" style={{fontFamily:"sans-serif"}}>
              SignUp
            </Button>
            <Button variant="dark" type="submit" size="lg" style={{fontFamily:"sans-serif"}}>
              Login
            </Button>
          </div>
        </Form>
      </div>
    </>
  );
}

export default Patientx;
